import Vue from 'vue';
import Router from 'vue-router';
import HomePage from '../components/HomePage.vue';
import RegisterPage from '../views/RegisterPage.vue';
import AcercaDe from '../components/acerca_de.vue'; // Importar la p치gina

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Home',
      component: HomePage
    },
    {
      path: '/register',
      name: 'Register',
      component: RegisterPage
    },
    {
      path: '/acerca_de',  // Ruta para la p치gina "Acerca de"
      name: 'AcercaDe',
      component: AcercaDe
    }
  ]
});
